import {Box,Text,Image} from '@chakra-ui/react';
import {AppContext} from '../context/AppContextProvider';
import React from 'react';

function LoggedIn(){


    return(
        <Box display='flex' p='5' flexDirection="row">
            <Box>
                <Image src='https://www.kindmeal.my/images/icon_notice.png' alt=''/>
                <Box position='relative' left='5' bottom='5' color='white'>0</Box>
                <Box mt='-5' boxShadow='0px 5px 10px #888888' height='80px' zIndex='0' bgColor='white'><center>You Currently have no notification</center></Box>
            </Box>
        </Box>
    )
}

export default LoggedIn;
